(defn calc-average-time-and-nmi
  [model number-of-sample-sequencies number-of-particles & [hyper-priors]]
  (let
    [time-and-nmis (get-evaluation-result-and-time (draw-sample-sequencies model number-of-sample-sequencies number-of-particles hyper-priors))]
    (list (first time-and-nmis) (average (map calc-nmi-for-Iris (second time-and-nmis))))))

